import { Card, CardContent, Grid, Typography } from "@mui/material";

const CreateTeam = () => {
    return (
        <Grid item sx={12} sm={12} md={4}>
            <Card>
                <CardContent>
                    <Typography>
                        Team
                    </Typography>
                </CardContent>
            </Card>
        </Grid>
    ); 
};

export default CreateTeam;
